import React, { useState } from "react";
import axios from "axios";
import { ToastContainer, toast } from "react-toastify";
import "react-toastify/dist/ReactToastify.css";

const LoanForm = () => {
  const [formData, setFormData] = useState({
    feature1: "",
    feature2: "",
    feature3: "",
    // Add all 31 features here
  });

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('http://localhost:5000/predict', formData);
      toast.success(`Prediction: ${response.data.prediction}`);
    } catch (error) {
      toast.error(`Error: ${error.response?.data?.error || error.message}`);
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      <input type="text" name="feature1" onChange={handleChange} placeholder="Feature 1" required />
      <input type="text" name="feature2" onChange={handleChange} placeholder="Feature 2" required />
      <input type="text" name="feature3" onChange={handleChange} placeholder="Feature 3" required />
      {/* Add all 31 features here */}
      <button type="submit">Submit</button>
      <ToastContainer />
    </form>
  );
};

export default LoanForm;
